import React from 'react';
import HeaderForms from './Components/HeaderForms';
import {Container} from '@material-ui/core';
import {Box} from '@mui/material/Box';

function App() {
  return (
    <Container fixed>
      <Box>
        <HeaderForms/>
      </Box>
    </Container>
  );
}

export default App;
